export const Skills = props => {
  return (
    <div>
      <label htmlFor='label' className='skills-title'>{props.title}</label>
      <div className='progress'>
        <div className="progress-bar bg-info" role="progressbar" style={props.width} aria-valuenow={props.value} aria-valuemin={0} aria-valuemax={100} />
      </div>
    </div>
  )
}
